import { Component } from 'react';

class App extends Component {


  constructor(props){
    super(props);
    this.state={

      items: ["item1","item2"]

    }
  }



  render(){
    return (
      <div className="App">
        <input type="text" />
        <button>Add</button>
        <ul>
          <li>Item 1 <button>Delete</button></li>
          {this.state.items.map((itm,k)=>{
            return(
              <li>{itm} <button></button></li>
            )
          })}
        </ul>
      </div>
    );

  }

}

export default App;
